import React from 'react'
import {social} from '../data';


const Social = () => {
  return (
   <ul className='flex space-x-6'>
      {social.map((item,index)=> {
        return <li className='flex justify-center items-center text-accent'></li>
      })}
   </ul>
  )
}

export default Social
